<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br><b>Qt</b> est une API orientée objet et développée en C++ par Qt Development Frameworks, filiale de Nokia. Qt offre des composants d'interface graphique (widgets), d'accès aux données, de connexions réseaux, de gestion des fils d'exécution, d'analyse XML, etc. Qt ressemble à un framework lorsqu'on l'utilise pour concevoir des interfaces graphiques ou que l'on conçoit l'architecture de son application en utilisant les mécanismes des signaux et slots par exemple.
Qt permet la portabilité des applications qui n'utilisent que ses composants par simple recompilation du code source. Les environnements pris en charge sont les Unix (dont GNU/Linux) qui utilisent le système graphique X Window System ou Wayland, Windows, Mac OS X, Tizen et également Genode. Le fait d'être une bibliothèque logicielle multiplateforme attire un grand nombre de personnes qui ont donc l'occasion de diffuser leurs programmes sur les principaux OS existants.

Qt intègre des bindings avec plus d'une dizaine de langages autres que le C++, comme Ada, C#, Java, Python, Ruby, Visual Basic, etc.

Qt est notamment connu pour être le framework sur lequel repose l'environnement graphique KDE Plasma, l'un des environnements de bureau par défaut de plusieurs distributions GNU/Linux.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="programme-principal--main-">Programme principal (main)</a>
</h1>
<div class="Section6"><br>La fonction (main) est le point d'entrée d'un programme Qt écrit en C++.<br><br>Programme principal.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
int main(int _argc, char** _argv) {
    QApplication lApp(_argc, _argv);
    MainWindow lWindow;
    lWindow.show();
    return lApp.exec();
}
//===============================================</pre><br>Le fichier projet (GProject.pro) permet définir les fichiers source (.cpp, .h, .ui) utilisés par le projet.<br><br>Format d'un fichier projet.<br><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">#================================================
QT       += core gui
CONFIG   += c++14
#================================================
greaterThan(QT_MAJOR_VERSION, 4): QT += widgets
#================================================
TARGET = setup
TEMPLATE = app
#================================================
SOURCES += main.cpp\
    MainWindow.cpp \
    Task.cpp
#================================================
HEADERS  += MainWindow.h \
    Task.h
#================================================
FORMS    += MainWindow.ui \
    Task.ui
#================================================</pre><br>Ce qu'il faut savoir:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Le template (app) indique à Qt que le projet est un fichier exécutable.</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">La cible (setup) indique le nom du fichier exécutable.</div>
</div><br>L'utilitaire (qmake) permet de générer les fichiers de construction (Makefile) à partir d'un fichier projet (GProject.pro).<br><br>Génération des fichiers de construction.<br><br><pre class="GCode1 Code1 AceCode" data-mode="batchfile" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">::===============================================
qmake
::===============================================</pre><br>L'utilitaire (mingw32-make) permet de construire le projet.<br><br>Construction du projet.<br><br><pre class="GCode1 Code1 AceCode" data-mode="batchfile" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">::===============================================
mingw32-make
::===============================================</pre><br>Le fichier exécutable généré (setup.exe) permet de démarrer l'exécution du projet.<br><br>Exécution du projet.<br><br><pre class="GCode1 Code1 AceCode" data-mode="batchfile" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">::===============================================
release\setup.exe
::===============================================</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="debogage-d-un-programme--gdb-">Débogage d'un programme (gdb)</a>
</h1>
<div class="Section6"><br>L'opérateur (debug) permet d'activer les options de débogage à partir fichier projet (GProject.pro).<br><br>Activation des options de débogage.<br><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">#================================================
CONFIG   += c++14 debug
#================================================</pre><br>Démarrage du projet en mode débogage.<br><br><pre class="GCode1 Code1 AceCode" data-mode="batchfile" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">::===============================================
gdb -ex run --args debug\setup
::===============================================</pre><br>Ce qu'il faut savoir:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">La touche (Entrée) permet de répéter l'exécution de la dernière commande.</div>
</div><br>La commande (br) permet de placer un point d'arrêt dans le débogueur.<br><br>Placement d'un point d'arrêt.<br><br><pre class="GCode1 Code1 AceCode" data-mode="txt" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">br MainWindow::MainWindow</pre><br>La commande (r) permet de redémarrer le débogueur et de s'arrêter au premier point d'arrêt.&nbsp;<br><br>Redémarrage du débogueur.<br><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">r</pre><br>La commande (n) permet passer à la ligne de code suivante.<br><br>Passage à la ligne de code suivante.<br><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">n</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>La commande (c) permet de passer au point d'arrêt suivant.<br><br>Passage au point d'arrêt suivant.<br><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">c</pre><br>La commande (bt) permet d'afficher la pile des appels.<br><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">bt</pre><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div></div></div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="gestion-des-connexions--signal-slot-">Gestion des connexions (signal/slot)</a>
</h1>
<div class="Section6"><br>La classe (QObject) fournit la méthode (connect) qui permet de définir une connexion (signa/slot).<br><br>Définition d'une connexion (signal/slot).<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
MainWindow::MainWindow(QWidget *parent)
: QMainWindow(parent)
, ui(new Ui::MainWindow)
, mTasks() {
    ui-&gt;setupUi(this);
    connect(ui-&gt;addTaskButton, &amp;QPushButton::clicked, this, &amp;MainWindow::addTask);
    updateStatus();
}
//===============================================</pre><br>Ce qu'il faut savoir:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">L'émetteur est le bouton (addTaskButton).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Le récepteur est la fenêtre elle-même (this).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Le signal émis est le clic sur le bouton (clicked).</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Le slot reçu est représenté par la méthode (addTask).</div>
</div><br>La fenêtre (MainWindow) définit le slot (addTask) qui permet d'ajouter une tâche.<br><br>La macro (Q_OBJECT) permet d'autoriser l'utilisation des connexions (signal/slot) au sein d'une classe.<br><br>La macro (slots) permet de déclarer une méthode en tant que slot.<br><br>Déclaration d'un slot:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
class MainWindow : public QMainWindow {
    Q_OBJECT

public slots:
    void addTask();
};
//===============================================</pre><br>Définition d'un slot.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void MainWindow::addTask() {
    bool ok;
    QString name = QInputDialog::getText(this, tr("Add task"),
                                         tr("Task name"), QLineEdit::Normal,
                                         tr("Untitled task"), &amp;ok);
    if (ok &amp;&amp; !name.isEmpty()) {
        qDebug() &lt;&lt; "Adding new task";
        Task* task = new Task(name);
        connect(task, &amp;Task::removed, this, &amp;MainWindow::removeTask);
        connect(task, &amp;Task::statusChanged, this, &amp;MainWindow::taskStatusChanged);
        mTasks.append(task);
        ui-&gt;tasksLayout-&gt;addWidget(task);
        updateStatus();
    }
}
//===============================================</pre><br></div>
</div></div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="gestion-d-une-liste--qvector-">Gestion d'une liste (QVector)</a>
</h1>
<div class="Section6"><br>La classe (QVector) fournit la méthode (append) qui permet d'ajouter un élément à la fin de la liste.<br><br>Ajout d'un élément à la fin de la liste.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
QVector&lt;Task*&gt; mTasks;
//===============================================
mTasks.append(task);
//===============================================</pre><br>La classe (QVector) fournit la méthode (removeOne) qui permet de supprimer le premier élément recherché.<br><br>Suppression du premier élément recherché.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
QVector&lt;Task*&gt; mTasks;
//===============================================
mTasks.removeOne(task);
//===============================================</pre><br>Les opérateurs (for, auto, :) permet de parcourir une liste d'éléments en (C++11).<br><br>Parcours d'une liste d'éléments.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
QVector&lt;Task*&gt; mTasks;
//===============================================
for(auto task : mTasks)  {
    if (task-&gt;isCompleted()) {
        completedCount++;
    }
}
//===============================================</pre><br></div></div></div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="gestion-des-layouts--qlayout-">Gestion des layouts (QLayout)</a>
</h1>
<div class="Section6"><br>La classe (QLayout) fournit la méthode (addWidget) qui permet d'ajouter un composant graphique (widget) au layout.<br><br>Ajouter un composant graphique (widget) au layout.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
QVBoxLayout *tasksLayout;
//===============================================
ui-&gt;tasksLayout-&gt;addWidget(task);
//===============================================</pre><br>La classe (QLayout) fournit la méthode (removeWidget) qui permet de supprimer un composant graphique (widget) du layout.<br><br>Suppression d'un composant graphique (widget) du layout.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
QVBoxLayout *tasksLayout;
//===============================================
ui-&gt;tasksLayout-&gt;removeWidget(task);
delete task;
//===============================================</pre><br>Ce qu'il faut savoir:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Il faudra utiliser l'opérateur (delete) pour supprimer le composant de la mémoire dynamique.</div>
</div><br></div></div></div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="utilisation-du-designer--qtdesigner-">Utilisation du designer (QtDesigner)</a>
</h1>
<div class="Section6"><br>L'utilitaire (QtCreator) permet créer des composants graphiques éditable par le designer (QtDesigner).<br><br>Création d'une classe d'interface graphique (QtDesigner).<br><br><pre class="GCode1 Code1 AceCode" data-mode="text" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">Fichier
New File
Files and Classes &gt; Qt &gt; Classe d'interface graphique Qt Designer
Choose
Templates\Forms &gt; Widget
Suivant
Class name &gt; GTask
Header file &gt; GTask.h
Source file &gt; GTask.cpp
Form file &gt; GTask.ui
Path &gt; C:\dev\qt\designer
Suivant
Terminer</pre><br>Cela génèrera 3 fichiers:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Un fichier header (GTask.h)</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Un fichier source (GTask.cpp)</div>
</div>
<div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">Un fichier form (GTask.ui)</div>
</div><br>Ficher header (GTask.h).<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
#ifndef _GTask_
#define _GTask_
//===============================================
#include &lt;QWidget&gt;
//===============================================
namespace Ui {
class GTask;
}
//===============================================
class GTask : public QWidget {
    Q_OBJECT

public:
    explicit GTask(QWidget *parent = nullptr);
    ~GTask();

private:
    Ui::GTask *ui;
};
//===============================================
#endif
//===============================================</pre><br>Fichier source (GTask.cpp).<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
#include "GTask.h"
#include "ui_GTask.h"
//===============================================
GTask::GTask(QWidget *parent)
: QWidget(parent)
, ui(new Ui::GTask) {
    ui-&gt;setupUi(this);
}
//===============================================
GTask::~GTask() {
    delete ui;
}
//===============================================</pre><br>Fichier form (GTask.ui).<br><br><pre class="GCode1 Code1 AceCode" data-mode="xml" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">&lt;!-- ============================================ --&gt;
&lt;ui version="4.0"&gt;
    &lt;author/&gt;
    &lt;comment/&gt;
    &lt;exportmacro/&gt;
    &lt;!-- ============================================ --&gt;
    &lt;class&gt;GTask&lt;/class&gt;
    &lt;!-- ============================================ --&gt;
    &lt;widget name="GTask" class="QWidget"&gt;
        &lt;!-- ============================================ --&gt;
        &lt;property name="geometry"&gt;
            &lt;rect&gt;
                &lt;x&gt;0&lt;/x&gt;
                &lt;y&gt;0&lt;/y&gt;
                &lt;width&gt;400&lt;/width&gt;
                &lt;height&gt;300&lt;/height&gt;
            &lt;/rect&gt;
        &lt;/property&gt;
        &lt;!-- ============================================ --&gt;
        &lt;property name="windowTitle"&gt;
            &lt;string&gt;Form&lt;/string&gt;
        &lt;/property&gt;
        &lt;!-- ============================================ --&gt;
    &lt;/widget&gt;
    &lt;!-- ============================================ --&gt;
    &lt;pixmapfunction/&gt;
    &lt;connections/&gt;
&lt;/ui&gt;
&lt;!-- ============================================ --&gt;</pre><br>Forme initiale dans le designer.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Edition dans le designer.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div></div></div></div><br>